        require(super.balanceOf(newMintingAddress)==0, "BT07");
        if(super.balanceOf(_mintingAddress)>0){
            _tokenTransfer(_mintingAddress, newMintingAddress, super.balanceOf(_mintingAddress));
        }
		_mintingAddress=newMintingAddress;
	}
